import React from "react";
import styled from "styled-components";
import { ReactComponent as OctopusLogo } from "../assets/logo.svg";

const Nav = () => {
  const Wrapper = styled.div`
    display: flex;
    flex-direction: row;
    align-items: center;
  `;

  const Logo = styled.svg`
    height: 30px;
  `;

  return (
    <Wrapper>
      <h1>Hello World</h1>
      <OctopusLogo />
    </Wrapper>
  );
};

export default Nav;
